    public static void main(String[] args) {
        System.out.println((new LeftMostColumnBinaryRowSorted()).leftMostColumnWithOne(new BinaryMatrix()));
    }

    public int leftMostColumnWithOne(BinaryMatrix binaryMatrix) {
        List<Integer> list = binaryMatrix.dimensions();
        int n = list.get(0);
        int m = list.get(1);

        int min = Integer.MAX_VALUE;
        for (int row = 0; row < n; row++) {
            int i = 0, j = m - 1;

            while (i <= j) {
                int mid = i + (j - i) / 2;
                int middleEle = binaryMatrix.get(row, mid);
                if (middleEle == 1) {
                    min = Math.min(min, mid);
                    j = mid - 1;
                } else {
                    i = mid + 1;
                }
            }
        }
        if (min == Integer.MAX_VALUE) min = -1;
        return min;
    }
